CREATE TABLE `rel_dist_cato` (
  `dist_id` int(11) NOT NULL DEFAULT '0' COMMENT '地区id',
  `cato_id` int(11) NOT NULL DEFAULT '0' COMMENT '分类类别id',
  PRIMARY KEY (`dist_id`,`cato_id`),
  KEY `index_cato_id` (`cato_id`),
  CONSTRAINT `FK_CATO_ID` FOREIGN KEY (`cato_id`) REFERENCES `t_catogory` (`cato_id`),
  CONSTRAINT `FK_DIST_ID` FOREIGN KEY (`dist_id`) REFERENCES `t_district_dict` (`dist_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='地区分类关系表';

