#
# Structure for table "t_doc_info"
#

CREATE TABLE `t_doc_info` (
  `doc_id` int(11) NOT NULL DEFAULT '0' COMMENT '文档主键',
  `doc_code` varchar(32) NOT NULL DEFAULT '' COMMENT '文档编码',
  `doc_title` varchar(64) NOT NULL DEFAULT '' COMMENT '文档标题',
  `doc_label` varchar(128) NOT NULL DEFAULT '' COMMENT '文档标签',
  `doc_size` varchar(24) NOT NULL DEFAULT '' COMMENT '文档大小',
  `doc_type` varchar(16) NOT NULL DEFAULT '' COMMENT '文档类型',
  `doc_path` varchar(255) NOT NULL DEFAULT '' COMMENT '文档存储路径',
  `doc_solr_code` varchar(32) NOT NULL DEFAULT '' COMMENT '文档solr编码',
  `doc_cato_id` int(11) NOT NULL DEFAULT '0' COMMENT '文档所属分类id',
  `read_times` int(11) NOT NULL DEFAULT '0' COMMENT '文档阅读次数',
  `cole_times` int(11) NOT NULL DEFAULT '0' COMMENT '文档收藏次数',
  `upload_user_id` int(11) NOT NULL DEFAULT '0' COMMENT '上传用户id',
  `upload_time` datetime NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '上传时间',
  PRIMARY KEY (`doc_id`),
  KEY `index_doc_cato_id` (`doc_cato_id`),
  KEY `FK_UPLOAD_USER_ID` (`upload_user_id`),
  CONSTRAINT `FK_DOC_CATO_ID` FOREIGN KEY (`doc_cato_id`) REFERENCES `t_catogory` (`cato_id`),
  CONSTRAINT `FK_UPLOAD_USER_ID` FOREIGN KEY (`upload_user_id`) REFERENCES `t_user_info` (`user_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

