#
# Structure for table "t_publish"
#

CREATE TABLE `t_publish` (
  `doc_id` int(11) NOT NULL DEFAULT '0' COMMENT '文档id',
  `pub_user_id` int(11) NOT NULL DEFAULT '0' COMMENT '发布用户id',
  `audit_user_id` int(11) NOT NULL DEFAULT '0' COMMENT '审核用户id',
  `pub_status` int(2) NOT NULL DEFAULT '0' COMMENT '发布状态：0表示待审核，1表示审核不通过，2表示回退，3表示审核通过',
  `operate_time` varchar(255) NOT NULL DEFAULT '' COMMENT '操作时间，依据发布状态判定操作时间含义',
  PRIMARY KEY (`doc_id`),
  KEY `FK_PUB_USER_ID` (`pub_user_id`),
  KEY `FK_AUDIT_USER_ID` (`audit_user_id`),
  CONSTRAINT `FK_AUDIT_USER_ID` FOREIGN KEY (`audit_user_id`) REFERENCES `t_user_info` (`user_id`),
  CONSTRAINT `FK_DOC_ID` FOREIGN KEY (`doc_id`) REFERENCES `t_doc_info` (`doc_id`),
  CONSTRAINT `FK_PUB_USER_ID` FOREIGN KEY (`pub_user_id`) REFERENCES `t_user_info` (`user_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='文档发布表';

